import React from 'react';
import './footer.css'
import { Container, Row, Col, ListGroup, ListGroupItem } from 'reactstrap';
import { Link } from 'react-router-dom';
import logo from '../../assets/images/logo.png';
import galleryImages from '../images-gallery/imagesgalley';




const Quick__links = [
  {
    path: '/home',
    display: 'Home'
  },
  {
    path: '/about',
    display: 'About'
  },
  {
    path: '/tours',
    display: 'Tours'
  },
];


const Quick__links2 = [
  {
    path: '/gallery',
    display: 'Gallery'
  },
  {
    path: '/login',
    display: 'Login'
  },
  {
    path: '/register',
    display: 'Register'
  },
];

const Footer = () => {
  return (
    <footer className='footer'>
      <Container>
        <Row>
          <Col lg='3'>
            <div className='logo'>
              <img src={logo} alt=''></img>
              <p>Lorem ipsum dolor, sit amet consectetur
                adipisicing elit. At in alias vero placeat
                ! Voluptatem eius similique suscipit! Eum, d
                electus numquam. Quas, aperiam porro voluptatum
                unde suscipit nostrum enim voluptatibus sunt?</p>
              <div className='social__links d_flex align-item-center gap-4'>
                <span>
                  <Link to='#'><i className='ri-youtube-line'></i></Link>
                </span>
                <span>
                  <Link to='#'><i className='ri-github-fill'></i></Link>
                </span>

                <span>
                  <Link to='#'><i className='ri-instagram-line'></i></Link>
                </span>


              </div>
            </div>
          </Col>
          <Col lg='3'>
            <h5 className='footer__link-title'>Discover</h5>
            <ListGroup className='footer__quick-links'>
              {Quick__links.map((item, index) => (
                <ListGroupItem key={index} className='ps-0 border-0'>
                  <Link to={item.path}>{item.display}</Link>
                </ListGroupItem>
              ))}
            </ListGroup>

          </Col>

          <Col lg='3'>
          <h5 className='footer__link-title'>Quick links</h5>
            <ListGroup className='footer__quick-links'>
              {Quick__links2.map((item, index) => (
                <ListGroupItem key={index} className='ps-0 border-0'>
                  <Link to={item.path}>{item.display}</Link>
                </ListGroupItem>
              ))}
            </ListGroup>
          </Col>

          <Col lg='3'>
          <h5 className='footer__link-title'>Contacts</h5>
            <ListGroup className='footer__quick-links'>

                <ListGroupItem className='ps-0 border-0 d-flex-align-items-center gap-3'>
                  <h6><span>
                    <i className='ri-map-pin-line'></i>
                    </span>
                    Address:
                    </h6>

                </ListGroupItem>

            </ListGroup>
          </Col>


        </Row>
      </Container>

    </footer>
  )
}
export default Footer;
